import {FETCH_USERWOO, RECEIVE_USERWOO} from "../constants/ActionTypes";

const initialState = {
  products: [],
  symbol: "$",
  product_details: [],
};

const userWooReducer = (state = initialState, action) => {
  console.log(action);
  switch (action.type) {
    case RECEIVE_USERWOO: {
      console.log(action);
      return {
        ...state,
        userWoo: action.userWoo,
      };
    }
    case FETCH_USERWOO: {
      return {
        ...state,
        userWoo: action.userWoo,
      };
    }
  }
};
export default userWooReducer;
